import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Platform, Text, View, ImageBackground, TextInput } from 'react-native';

export default function App() {
  return (
    <View style={styles.container}>
      <ImageBackground
        style={styles.image}
        source={require('./Screens/bebr.jpg')}
      >
        <Text style={styles.text}>sadada</Text>
        <TextInput style={styles.input} />
      </ImageBackground>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff'
  },
  image: {
    flex: 1,
    resizeMode: 'cover',
    justifyContent: 'center'
  },
  text: {
    color: 'white'
  },
  input: {
    borderWidth: 1,
    borderColor: '#f0f8ff',
    height: 40,
    borderRadius: 6,
    marginHorizontal: 40,
    color: '#f0f8ff',
    textAlign: 'center'
  }
});
